    "2015-02-04T19:39:41.899249",nt"name": "performance-metrics-chicago-park-district-facilities-work-order-management-9a082",nt"isopen":
    false,nt"url": null,nt"notes": "The Facility Management Department works
    to ensure safe, clean and high quality parkland and facilities throughout the City
    of Chicago by utilizing the highest effective maintenance standards/procedures and
    management practices. This department is responsible for the maintenance, repair,
    renovation and general upkeep of all Park District property such as field houses,
    swimming pools, comfort stations, park amenities, etc. The data displayed represents
    the weekly number of work orders completed compared to the number open by the Facilities
    Department. rnrnPlease note that the number is cumulative, the previous weeks open
    work orders roll into the current week, which during seasonal fluctuations may cause
    the number completed to outpace the number opened.",nt"license_title": "License
